import React, {useState} from 'react';
import {Ship, ShipSection} from './ShipSection';
import {Liquid, LiquidComponent, LiquidComponentType, LiquidSection} from './LiguidSection';
import {gql} from 'apollo-boost';
import {useMutation} from '@apollo/react-hooks';
import {Calculation} from '../../pages/ResultsPage';

const CALCULATE = gql`
    mutation Calculate($ship: ShipInput!, $liquid: FluidInput!, $transport: TransportInput!, $standard: StandardInput!) {
        addCalculation(ship: $ship, fluid: $liquid, transport: $transport, standard: $standard) {
            id
        }
    }
`;

export const CalculateFormContainer = () => {
  const [ship, setShip] = useState<Ship>({name: '', country: ''});
  const [liquid, setLiquid] = useState(
    new Map<LiquidComponentType, number>([
      [LiquidComponentType.NITROGEN, 0],
      [LiquidComponentType.METHANE, 0],
      [LiquidComponentType.ETHANE, 0],
      [LiquidComponentType.PROPANE, 0],
      [LiquidComponentType.I_BUTANE, 0],
      [LiquidComponentType.N_BUTANE, 0],
      [LiquidComponentType.I_PENTANE, 0],
      [LiquidComponentType.N_PENTANE, 0],
      [LiquidComponentType.N_HEXANE, 0],
    ])
  );

  const [addCalculation, {data}] = useMutation<Calculation, { ship: Ship, liquid: Liquid, transport: any, standard: any }>(CALCULATE, {
    variables: {
      ship,
      liquid: liquid.map((componentName, componentValue) => {

      }),
      transport: {
        volume: 50,
        pressure: 50,
        boilOffRate: 50,
        fromDate: "2019-09-17T06:54:07Z",
        toDate: "2019-09-17T06:54:07Z"
      },
      standard: {combustionTemperature: 15, measurementTemperature: 15, idealGasReferenceState: true},
    }
  });

  console.log(data);

  return (
    <form onSubmit={(e) => {
      e.preventDefault();
      addCalculation();
    }}>
      <ShipSection ship={ship} setShip={setShip}/>
      <LiquidSection liquid={liquid} setLiquid={setLiquid}/>
      <button>Compute</button>
    </form>
  );
};
